                      className="btn btn-light"
                      id="quarter"
                      onClick={() => {
                        setFiscalPeriodType("quarter");
                        document
                          .getElementById("annual")
                          .classList.remove("active");
                        document
                          .getElementById("quarter")
                          .classList.add("active");
                        document
                          .getElementById("interim")
                          .classList.remove("active");
                      }}
                    >
                      QUARTER
                    </a>
                  </span>
                  <span className="tabs">
                    {" "}
                    <a
                      className="btn btn-light"
                      id="interim"
                      onClick={() => {
                        setFiscalPeriodType("Interim");
                        document
                          .getElementById("annual")
                          .classList.remove("active");
                        document
                          .getElementById("quarter")
                          .classList.remove("active");
                        document
                          .getElementById("interim")
                          .classList.add("active");
                      }}
