                        </tr>

                        <tr>
                          <td>Details</td>
                          <td>Million RIYAL</td>
                          <td>Million RIYAL</td>
                          <td>Million RIYAL</td>
                          <td>Million RIYAL</td>
                          <td>Million RIYAL</td>
